import { useState } from 'react';






const ResultPage = ({userAnswers, resetQuiz, saveScore, name}) => {

    return(
        <div>
            <h2>Quiz Results</h2>
                <ul>
                    {userAnswers.map((ua, index) => (
                        <li key={index}>
                        Question {ua.question + 1}: Your answer - {ua.answer}
                        </li>
                    ))}
                </ul>
            <button onClick={resetQuiz}>Try Again</button>
            <button onClick={saveScore}>Save Score as: {name}</button>
        </div>
    );
}



export default ResultPage;
